ОКБ &quot;Беспилотного авиастроения&quot; рассказало о создании &quot;крохотного беспилотного летательного аппарата &laquo;Вектор-75&raquo;, являющегося аналогом норвежского дрона Black Hornet, стоимостью в 240 раз дешевле&quot;.&nbsp;


Всем известен микроаппарат Black Hornet массой 18 г, который имеют в распоряжении все военизированные подразделения НАТО. Мы создали микроскопический дрон &laquo;Вектор-75&raquo;, сухая масса которого составляет 21 грамм, а масса в снаряжённом состоянии &mdash; 32 г. Полётное время аппарата составляет от четырёх до семи минут. В зависимости от типа полезной нагрузки.

Black Hornet считается самым крошечным военным дроном в мире, а его цена составляет около 200 тыс. долларов. Цена дрона &laquo;Вектор-75&raquo; будет стартовать от 70 тыс. рублей (около 820 долларов), то есть в 240 раз дешевле.


Вообще все эти фразы &quot;мы создали аналог, только в 240 раз дешевле&quot; для меня звучат как &quot;Мы создали аналог &quot;Мерседеса&quot; под названием &quot;Лада Гранта&quot;. Наш автомобиль в 240 раз дешевле &quot;Мерседеса&quot; класса люкс, а значит, будет намного более востребован&quot;.

То есть это просто словеса, которые сотрясают воздух, более ничего. Что значит &quot;аналог, только в 240 раз дешевле&quot;? Black Hornet летит на расстояние до 1,9 км и продолжительность его полета 25 минут. Он может работать в диапазоне температур от -10 до +43 градусов. Имеет три камеры, тепловизор, светодиодную подсветку. Он может выполнять несколько разных задач, умеет возвращаться на место запуска, выводит изображение на планшет оператора.

А вот эта пупыка &quot;Вектор-75&quot; что имеет и что умеет? Полезное время - от 4 до 7 минут. У него камера-то вообще есть хоть одна? Одна вроде есть. На 1,3 Мпикс? А данные по защищенному каналу умеет передавать?

Так ничего не сообщается. А просто &quot;мы сделали аналог в 240 раз дешевле&quot;. Ясный пень, он в 240 раз дешевле, если он и умеет только взлететь, облететь комнату и вернуться. И они его совершенно на голубом глазу сравнивают с настоящим чудом инженерной мысли - реально боевым микродроном, стоящим на вооружении НАТО!&nbsp;

Ну и я уже молчу о самом заявлении ОКБ - &quot;Мы создали микроскопический дрон&quot;. Вообще-то таких микроскопических дронов на Ali - как грязи. Первый раз, что ли? Купили китайскую поделку, налепили свой логотип, после чего остается только трубить &quot;Мы сделали аналог Black Hornet&quot;!

Собственно, на Ali и клонов Black Hornet продается как грязи - по 120-160 евро.



Кстати, они даже не показали ни одного изображения этого устройства. То, что выше - просто иллюстрация с каким-то микродроном, которую в заметку поставил iXBT. Так что все из серии &quot;Мы сделали такой полный аналог, такой полный аналог! Но только мы вам его не покажем и не расскажем, что он вообще умеет&quot;. Пустая трескотня. Впрочем, как обычно.&nbsp;

Ревякин из группы &quot;Калинов МОСК&quot;. Впрочем, моск-то там давно протух.

Нату надо завалить, конечно. Покушаются, понимаешь, на наши земли и на наших писателей/композиторов XIX века. Вот сейчас Ревякин с гитарой и пойдет Нату заваливать!


&nbsp;

А я не про Пригожина, нет! Попалось тут в ленте FB - смотрите какой офигенный изврат!


&nbsp;


Нет, я себе такой не хочу. Я - человек сугубо цифровой, меня все эти катушки, кассеты, винил и прочие аналоговые игрушки не прикалывают совершенно. Я бумажную книгу-то в последний раз читал лет 20 назад, у меня их и дома-то вообще нет (кроме написанных мной: те зачем-то в шкафу стоят).

Старик Байден пару дней назад наделал шума, отвечая на вопросы журналистки на каком-то экологическом форуме, где он, во-первых, заявил, что Путин - он такой, он может шваркнуть ядерной бомбой, и, во-вторых, также сказал, что для вступления в НАТО Украина должна будет выполнить все требуемые 250 условий, иначе она в НАТО не попадет. И это все звучало крайне резким диссонансом с тем, что в последнее время заявлялось и делалось в мировой политике. Да и упоминать эти постоянные путинские нелепые угрозы ядерным оружием без напоминания о том, что с ним после этого сделают, если он обезумеет настолько, чтобы это применить (если он вообще физически сможет это сделать, в чем есть всякие обоснованные сомнения) - оно звучит крайне глупо, особенно в устах президента США.

Марк Фейгин подробно обсудил эту историю с Андреем Пионтковским. По мнению Пионтковского, ничего реально содержательного в этих заявлениях Байдена нет. Дедушка просто старенький, явно находится в небольшом маразме. Про НАТО он помнил, что там есть какие-то требования и несколько лет назад Украине эти требования предъявляли. Какие, на фиг, сейчас &quot;выполнения требований&quot;, когда идет эта война и Украина по сути одна (с помощью западного оружия, конечно, но сражаются-то только сами украинцы, других регулярных войск на ее территории нет, только иностранные добровольцы) защищает весь мир от опасного сумасшедшего с ядерной дубинкой - непонятно совершенно! Но Байден просто забыл, что война идет - бывает, дедушка старенький. Также Байден помнил, что раньше было принято бояться Путина с его ядерной дубинкой - ну, он в очередной раз это и повторил. Бывает. Сознание меркнет, мысли путаются. Not a big deal, короче говоря. Так считает Андрей Андреевич.

&nbsp;

Но вернемся к недавнему более или менее состоявшемуся мятежу, которому мы стали свидетелями. Я просто тут наткнулся на очень прикольный, хотя и изрядно шизофреничный текст одной ярой z-патриотки (спасибо ТК &quot;На Zzzzzападном фронте без перемен&quot;, создатель которого тщательно мониторит это болото), и мне было интересно почитать, как она объясняет произошедшее. Но о ней и этом посте - чуть позже, сначала я очень кратко напомню историю вопроса.&nbsp;

Вечером 23 июня Пригожин заявил, что по тыловым лагерям Вагнера Минобороны нанесло ракетные удары и, мол, погибло огромное количество бойцов. При этом было показано абсолютно невнятное видео, в котором пара-тройка человек, матерясь, бежало по лесу со словами &quot;что это было?&quot;, а потом показали полянку с несколькими деревьями как после взрыва, что-то где-то горело и какое-то тело лежало в кустах. Выглядело это предельно неумелой постановкой, но там с достоверностью никто напрягаться, очевидно, и не собирался.&nbsp;



